import React, { Component } from "react";
import NavComponent from "./navcomponent";

class VideosComponent extends Component {
  constructor(props) {
    super(props);
  }

  componentDidMount() {}

  render() {
    return (
      <div>
        <NavComponent />
      </div>
    );
  }
}

export default VideosComponent;
